import React from 'react';
import './Navbar.css'; // Import the CSS file
import { faBars, faSearch } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
function Navbar() {
    return (
        <nav>
          <label className="logo">DesignX</label>

          <input type="checkbox" id="check" className="check-input" />
          <label htmlFor="check" className="checkbtn">
            <FontAwesomeIcon icon={faBars} />
          </label>
          <form className="search-form" action="action_page.php">
            <input type="text" placeholder="Search.." name="search" />
            <button type="submit" className="search-button">
            <FontAwesomeIcon icon={faSearch} />
            </button>
        </form>
          <ul className="nav-links">
            <li><a className='active' href="#home">Home</a></li>
            <li><a href="#about">Clothing</a></li>
            <li><a href="#services">Electronics</a></li>
            <li><a href="#contact">Groceries</a></li>
            <li><a href="#feedback">Essentials</a></li>
          </ul>

        </nav>
      );
    }
export default Navbar;
